import React, { useState, useEffect } from "react";
import Axios from "axios";
import Select from "react-select";
import { Header } from "./PagesElements";
import "./PagesElements.css";

const Patient = () => {
  const [pesel, setPesel] = useState("");

  return (
    <div className="App">
      <div className="inputsWrapper">
        <div>
          <label>Imię</label>
          <input
            type="text"
            name="patient_name"
            onChange={(e) => {
              SetPatientName(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Nazwisko</label>
          <input
            type="text"
            name="patient_surname"
            onChange={(e) => {
              SetPatientSurname(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Pesel</label>
          <input
            type="text"
            name="patient_pesel"
            onChange={(e) => {
              SetPatientPesel(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Miasto zamieszkania</label>
          <input
            type="text"
            name="patient_city"
            onChange={(e) => {
              SetPatientCity(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Ulica zamieszkania</label>
          <input
            type="text"
            name="patient_street"
            onChange={(e) => {
              SetPatientStreet(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Numer domu</label>
          <input
            type="text"
            name="patient_house_number"
            onChange={(e) => {
              SetPatientHouseNumber(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Płeć</label>
          <input
            type="text"
            name="patient_gender"
            onChange={(e) => {
              SetPatientGender(e.target.value);
            }}
          />
        </div>
        <div>
          <label>Data Urodzenia</label>
          <input
            type="date"
            name="patient_date_of_birth"
            onChange={(e) => {
              SetPatientDateOfBirth(e.target.value);
            }}
          />
        </div>
      </div>
    </div>
  );
};

export default Patient;
